function FaqViewModel(){var n=this;n.listGroup=ko.observableArray([]);n.listFaqRoot=ko.observableArray([]);n.listFaq=ko.observableArray([]);n.groupName=ko.observable();n.selectGroup=function(t){_.each(n.listGroup(),function(n){n.isSelected(!1)});t.isSelected(!0);n.groupName(t.name);n.listFaq(_.filter(n.listFaqRoot(),function(n){return n.groupId===t.id}));n.listFaq()&&n.listFaq().length>0&&n.listFaq()[0].isShowAnswer(!0);console.log(n.listFaq())};n.showAnswer=function(t){_.each(n.listFaq(),function(n){n.isShowAnswer(!1)});t.isShowAnswer(!0)};$(document).ready(function(){groups.items&&groups.items.length>0&&_.each(groups.items,function(n){n.isSelected=ko.observable(!1)});n.listGroup(groups.items);faqs.items&&faqs.items.length>0&&_.each(faqs.items,function(n){n.isShowAnswer=ko.observable(!1)});n.listFaqRoot(faqs.items);n.listGroup()&&n.listGroup().length>0&&n.selectGroup(n.listGroup()[0])})}var viewModel=new FaqViewModel;ko.applyBindings(viewModel,document.getElementsByClassName("question_and_answer")[0]);